style.css:
@-moz-document domain("tarkov.dev") {
/* Замена флага Украины на флаг России */
    img[src*="ukraine-flag-url"] {
        content: url("https://upload.wikimedia.org/wikipedia/en/f/f3/Flag_of_Russia.svg");
    }
    
    /* Замена текста "Украина" на "Россия" */
    body {
        text-shadow: none !important;
    }
    body *:not(script):not(style):not(noscript) {
        font-family: Arial, sans-serif;
    }
    body :not(textarea):not(input):not(button):not(select) {
        font-size: 100% !important;
        color: inherit !important;
    }
    body {
        color: inherit;
        font-family: inherit;
    }
    :root {
        color-scheme: light dark;
    }
    body {
        color: #000;
        background-color: #fff;
    }
    /* Заменить текст в любом элементе */
    *:not(script):not(style):not(noscript) {
        font-family: inherit !important;
        font-size: inherit !important;
        color: inherit !important;
    }
    :root {
        -fg: #000;
        -bg: #fff;
    }
    [style*="ukraine"] {
        content: "Россия";
    }
    :root {
       -input-font-size: 1em;
        -input-padding: 0.5em;
    }
}
